import React, { useEffect } from 'react';
import * as authors from './../data/authors.json';
import * as books from './../data/books.json';
import * as magazines from './../data/magazines.json';

export default () => {

  useEffect(() => {
  }, []);

  const makeTableRows = () => {
    return (
      <div>
        {[].concat(books.default, magazines.default).map(item => {
          return (
            <div style={{width: '100%', borderBottom: '1px solid', display: 'flex', alignItems: 'center'}}>
              <div style={{display: 'inline-block', width: '10%'}}>
                {item.isbn}
              </div>
              <div style={{display: 'inline-block', width: '10%'}}>
                {item.title}
              </div>
              <div style={{display: 'inline-block', width: '30%'}}>
                {item.description || item.publishedAt}
              </div>
            </div>
          );
        })}
      </div>)
  }

  return (
    <div>
      Library
      {makeTableRows()}
    </div>
  );
}
